import React from 'react';

const SiteInfo = () =>{
    return(
        <div className="site-infro">
            <div className="title">
                UI system
            </div>
            <div className="sub-title">
                Web design | Mobile Apps
            </div>
        </div>
    );
}
export default SiteInfo;
